import React, {Fragment} from "react";
import bannerpic1 from "../img/bannerpic1.svg"
import Container from "react-bootstrap/Container";
import styled from "styled-components";


const Styles = styled.div`
  .main-special {
    position: relative;
    height: 36vh;
    width: 100%;
    background: #567786;
    cursor: pointer;
    overflow: hidden;
    padding-top: 2%;
    padding-bottom: 2%;
  }
  .header {
  }
  .textContainer {
    justify-content: center;
    padding: 5%;
    padding-top: 5%;
    padding-bottom: 5%;
  }
  .text {
    font-family: "Open Sans";
  }
`;

const Banner = () => {
  return (
   <div className="header"> 
   <Container fluid> 
    <img src={bannerpic1} alt="React Logo" />
       <h1> Banner </h1> 
  </Container>
   </div>
  );
};

export default Banner;
